    this.buildImageArray = function () {
        let arr = new Array(),
            p = self.lang.pages;

        for (var i = 0; i < p.length; i++) {
            let f = p[i].fields;

            for (var ii = 0; ii < f.length; ii++) {
                if (f[ii].Text === "" && f[ii].ImageURL !== "") {
                    let o = {
                        fileIndex: i,
                        file: p[i].File,
                        title: p[i].title,
                        key: f[ii].key,
                        src: f[ii].ImageURL,
                    },
                        exists = false;

                    for (var c = 0; c < arr.length; c++) {
                        if (JSON.stringify(arr[c]) === JSON.stringify(o)) {
                            exists = true;
                        }
                    }

                    if (exists === false) {
                        arr.push(o);
                    }
                }
            }
        }

        self.imgArrayCreated = true;

        return arr;
    };

